Text:
Tjaba.
Allting fungerar för mig förutom när jag skulle föra över kartorna till gpsén, då var dom inte upplåsta för just min gps. Det ska visst finnas någon program som heter garmwackar eller nåt för just Garmin gpser, man går "in" i gpsen och ändrar serienummret för att sedan kunna låsa upp. Någon som har någon erfarenhet av detta?
//Lento
